import React from "react";
import data from "../../data.json";

function Category() {
  console.log(data);
  return (
    <div className="category">
      <div className="container">
        <div className="row">
          <div className="col-lg-4">
            <img src="" />
          </div>
          <div className="col-lg-4"></div>
          <div className="col-lg-4"></div>
        </div>
      </div>
    </div>
  );
}

export default Category;
